import React, { Component } from "react";

class CadastroProduto extends Component {
  constructor(props) {
    super(props);

    this.state = {
      listProducts: "",
    };
  }
  componentDidMount() {
    if (this.props.location.list) {
      this.setState({
        listProducts: this.props.location.list.products,
      });
    }
  }

  render() {
    return (
      <div>
        <ul>
          {this.state.listProducts.map((item, key) => {
            return (
              <li key={key}>
                <span>{item[0]}</span>
                <span>{item[1]}</span>
              </li>
            );
          })}
        </ul>
      </div>
    );
  }
}
export default CadastroProduto;
